package org.zkoss.zktest.zats.test2;

import static org.junit.Assert.assertEquals;

import org.junit.Test;

import org.zkoss.zktest.zats.WebDriverTestCase;
import org.zkoss.zktest.zats.ztl.JQuery;

public class F86_ZK_3913Test extends WebDriverTestCase {
	@Test
	public void test() {
		connect();
		String dataUrl = "data:image/png;base64,";
		String dataUrl2 = "data:image/png;base64,";
		assertEquals(3, jq("canvas").length());
		JQuery canvasjq = jq("canvas:eq(0)");
		int height = canvasjq.height();
		int width = canvasjq.width();
		assertEquals(100, height);
		assertEquals(114, width);
		String data = canvasjq.toElement().eval("toDataURL()");
		waitResponse();
		assertEquals(dataUrl, data);
		click(jq("$act1"));
		waitResponse();
		height = canvasjq.height();
		width = canvasjq.width();
		assertEquals(100, height);
		assertEquals(532, width);
		data = canvasjq.toElement().eval("toDataURL()");
		waitResponse();
		assertEquals(dataUrl2, data);
	}
}
